Gün boyu mükemmelliğini kaybetmeyecek bir kaş kalemi! 

Kaşları düzeltmek için fırçayı kullanın; 
Kaş çizgisini doldurmak ve inceltmek için kalemi uygulayın; 
Oluşturulan çizgiyi yaymak ve yumuşatmak için fırçanın üzerinden geçin.

